  input: TEXT,F3XA,,"Chambers Associates manages THEPAC.  We perform various managerial
    and administrative duties assisting THEPAC along with accounting of receipts and
    disbursements for the committee.  Our fees for services are usually less than
    $200 per month and we do not always bill THEPAC on a monthly basis because of
    this.  Therefore, they do not receive a regular monthly billing.  Upon presentation
    of the bill to THEPAC, they report  and pay the billing  which is usually about  one  to
    two months after the services were performed.  Therefore, THEPAC has no way of
    knowing what costs they incur for each reporting period since they receive the
    billing on or after the period has ended.  June 2001 administrative expenses were
    actually reported on the Augustr filing which is due September 20, 2001."
